import React, { Component } from 'react';

class Login extends Component {
  render() {
    return (
      <div>
      <h3>Please Sign in</h3>
        <form id="loginform" method="post">
            <div className="form-group">
                <label for="user" className="control-label sr-only">User Name: </label>
                <input type="text" className="form-control" placeholder="User Name" name="user" id="user" />
                <div className="input-group">
                    <input className="form-control login-password" type="password" autocomplete="off" className="form-control" placeholder="Password" name="pwd" id="pwd" />
                    <label for="pwd" clasclassNames="control-label sr-only">Password: </label>
                    <span className="input-group-btn">
                        <button className="btn btn-default login-password" type="button" id="loginPasswordToggle" title="make password visible"><i className="glyphicon glyphicon-eye-open" id="loginPasswordToggleIcon"></i></button>
                    </span>
                </div>
            </div>
            <div className="form-group">
                <input type="submit" className="btn btn-lg btn-success btn-block" id="chk"  value="Login" />
            </div>
        </form>
        <hr />
        <button id="signup" className="btn btn-sm btn-default collapse" type="button">Sign Up</button>&nbsp; 
    <hr />
    </div>
    );
  }
}

export default Login;
